    "7416501": {
        "Desc": "Entra en la corriente marina",
        "Talk": [
            [
                {
                    "N": "Cruznarciso",
                    "T": "#Siento... Siento “razón”. Visitantes, ¿son ustedes l{F#a}{M#o}s hereder{F#a}{M#o}s de la Cruz de los Narcisos, o son una amenaza?"
                },
                {
                    "N": "Cruznarciso",
                    "T": "Veo que has desenvainado el arma, así que la respuesta está clara."
                },
                {
                    "N": "Anne",
                    "T": "Cruznarciso..."
                },
                {
                    "N": "_1005",
                    "T": "¿Eh? ¿Esta cosa es Cruznarciso?"
                },
                {
                    "N": "Cruznarciso",
                    "T": "#Si han oído mi nombre, entonces son conocedor{F#a}{M#o}s de mi misión de salvar el mundo y la semilla de la salvación yace dentro de su consciencia."
                },
                {
                    "N": "Cruznarciso",
                    "T": "Si apuntan sus armas hacia mí, debe ser porque se han dejado embaucar por falacias. Pero no es momento de malgastar mi poder."
                },
                {
                    "N": "Cruznarciso",
                    "T": "¡Alégrense! ¡Regocíjense! Pues cuando todo haya concluido, daré respuestas y explicaciones. Pero, por ahora, dejen la Sacroespada en mis manos y busquen refugio."
                },
                {
                    "N": "_1005",
                    "T": "No te vamos a dar la Sacroespada."
                },
                {
                    "N": "Cruznarciso",
                    "T": "#Son ustedes un{F#a}{M#o}s neci{F#a}{M#o}s, pero aun así l{F#a}{M#o}s perdonaré y l{F#a}{M#o}s salvaré."
                },
                {
                    "N": "Cruznarciso",
                    "T": "Puedo sentir que los cuatro cuadrantes han sido revertidos, pero el árbol del flujo aún no está completo."
                },
                {
                    "N": "Cruznarciso",
                    "T": "Ya no es posible salvarlos a todos. Extenderé mi misericordia hasta alcanzar mi límite, aunque sea a expensas de mi propia vida."
                },
                {
                    "N": "Cruznarciso",
                    "T": "Si solo puedo salvar a cinco de cada diez, haré todo lo posible para convertirlo en seis de cada diez."
                },
                {
                    "N": "Cruznarciso",
                    "T": "Ahora, debo tomar la Sacroespada."
                }
            ]
        ]
    },
